  \"shiawassee-national-wildlife-refuge-annual-narrative-report-calendar-year-1994\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Shiawassee
  National Wildlife Refuge summarizes Refuge activities during the 1994 calendar year.
  \ The report begins with a summary of the yearu2019s highlights and climatic conditions.
  \ Land acquisition is also covered.  The report includes a planning section which
  discusses the management plan, public participation, compliance with environmental
  and cultural resource mandates, research, and investigations.  Refuge administration
  is outlined; information about personnel, youth programs, volunteer programs, funding,
  safety, and technical assistance is given.  Habitat management is also covered.
  \ Subjects include wetlands, forests, croplands, grasslands, fire management, pest
  control, wilderness areas, easements, and private lands.  The wildlife section of
  the report discusses wildlife diversity, endangered species, threatened species,
  waterfowl, marsh birds, waterbirds, shorebirds, raptors, game mammals, animal control,
  marking, and banding.  The public uses of the Refuge described in this report include
  outdoor classrooms, interpretive exhibits, hunting, fishing, trapping, wildlife
  observation, and law enforcement.  The equipment and facilities section of the report
  provides information about new construction, rehabilitation, major maintenance,
  and computers.  Cooperative programs and items of interest are provided at the end.
  \ Michigan Islands NWR and Wyandotte NWR- both administered by Shiawassee NWR- are
  summarized at the end.  Refuge brochures are attached.\",\n\t\"license_title\":
